                        "Desc": "情熱のビートを大地に響かせよ！シロネンは高速戦闘用のローラーブレード装備に切り替える。同時に前方へ一定距離突進し、シロネンの防御力を基に夜魂性質の<color style='color:#FFE699;'>岩元素ダメージ</color>を与える。<br>発動後、シロネンは夜魂値を45獲得し、夜魂の加護状態に入る。この状態の時、シロネンは「ブレードハント」モードに切り替わる。<br><br><color style='color:#FFD780;'>サンプル音源</color><br>シロネンは3つのサンプラーを持ち、その中にチーム内の他キャラクターの元素タイプに応じて、異なる「音」を取り入れる。サンプル音源をアクティブ化した時、近くの敵は対応する元素耐性がダウンする。<br>3つのサンプラーの初期「サンプル音源」は<color style='color:#FFE699;'>岩元素</color>である。チーム内に<color style='color:#FF9999;'>炎元素</color>、<color style='color:#80C0FF;'>水元素</color>、<color style='color:#99FFFF;'>氷元素</color>または<color style='color:#FFACFF;'>雷元素</color>のキャラクターが1名いる毎に、<color style='color:#FFE699;'>岩元素</color>のサンプル音源1つが該当の元素タイプに変わる。<br>夜魂の加護状態にある時、シロネンが持つ<color style='color:#FFE699;'>岩元素</color>の「サンプル音源」は、常時アクティブ状態を維持する。固有天賦「四境四象の残響」開放後、その天賦効果を発動することで、シロネンは自身の夜魂値を回復できる。夜魂値が上限に達した時、シロネンは夜魂値をすべて消費し、自身が持つ3つの「サンプル音源」を15秒間アクティブ化する。<br>「サンプル音源」のアクティブ化中、近くの敵は対応する元素耐性がダウンする。なお、同じ元素タイプの「サンプル音源」の効果は重ね掛け不可。シロネンが待機中でも効果を発動できる。<br><br><color style='color:#FFD780;'>夜魂の加護・シロネン</color><br>持続的に夜魂値を消費する。夜魂値が尽きた時や再発動時、シロネンの夜魂の加護状態は終了する。夜魂の加護状態は以下の特性を持つ。<br>・「ブレードハント」モードに切り替わり、シロネンの移動速度と登る速度がアップ。また、登る時にはオセロット形態で高速跳躍ができるようになる。<br>・シロネンの夜魂の加護状態には、次の制限がある。夜魂の加護状態にある時、シロネンの夜魂値は9秒の制限時間があり、制限時間を超えると、シロネンの夜魂値は直ちに尽きる。<br><br>夜魂の加護状態にある時、夜魂値が尽きると、シロネンは固有天賦「四境四象の残響」による夜魂値を獲得できなくなる。<br><br><i>ある意味、宝石の加工と音楽のミキシングには共通する部分があるかもしれない——不純物を取り除き、最も輝くものだけを残す。<br>それについて、シロネンは気にしたことがない。何しろ彼女にとって、どちらもこの上なく楽しいことだからだ。</i>",
